      | 364242 -> { ItemTypeData.id= 364242; name= "Federal Defense Union Scout G-I"; published= false; description= "The Scout dropsuit is a lightweight suit optimized for enhanced mobility, multi-spectrum stealth, and heightened awareness. Augmented joint servo motors give every movement extra speed and flexibility, while integrated friction and impact dampening materials reduce the overall sound signature.     This high-tech suit is coated in adaptive camouflage, a thin layer of bio-hermetic membranes interwoven with microscopic optical sensors that control millions of individual pigment ferro-crystals. An integrated AI-53 “All Eyes” sensor system wraps around the inside of the helmet, which also includes a chemically scrubbed atmospheric filtration system.    When missions call for speed and stealth, situations in which heavily armored suits would be more of a burden than an advantage, a scout dropsuit is the best option. The enhanced mobility it provides makes up for its relatively low protection, and when combined with stealth technology modules, the scout suit is the obvious choice for infiltration, counter-espionage, and assassination."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
