      | 48507 -> { ItemTypeData.id= 48507; name= "Broadsword Dawn of Liberation SKIN"; published= true; description= "The Great Rebellion was the dawn of liberation for the Minmatar tribes that once lived almost entirely under the dominion of the Amarr. When the slave revolt broke out in 20 BYC (AD 23216), it stunned an Amarr Empire already reeling from the shock of their defeat by the Jovian fleet at the Battle of Vak'Atioth.    The Minmatar that rose up were quickly able to cut a swathe through the territories surrounding the Matari home worlds, aided by groups of free Minmatar who had long operated as guerilla fighters both planet-side and in space. The Minmatar Republic was founded by four of the great tribes and was invited to join in the foundation of CONCORD in 3 BYC. By the end of YC 111, the Nefantar, Starkmanir and Thukker Tribes had rejoined their Brutor, Krusual, Sebiestor and Vherokior brothers and sisters in the Minmatar's Tribal Republic."; marketGroupId= Some(2076); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
