      | 54230 -> { ItemTypeData.id= 54230; name= "Gila Helmatt's Harriers SKIN"; published= true; description= "One of the Guristas Pirates most notorious and brash combat pilots, Lucash Helmatt has carved out a spot for himself as a key leader of Guristas raids on the forces of law and order. Helmatt's personal wing of raiders, the Harriers, is feared far-and-wide across the systems bordering the Guristas territories in nullsec.    In his typical style, Lucash had all Helmatt's Harriers ships painted in bright and disruptive yellow and black with an eye to intimidation and maintaining his personal notoriety. The Harriers are also notable for harboring a large number of combat pilots originating from other pirate and crime organizations across New Eden. Helmatt himself has a long and brutal career in the Angel Cartel before defecting to the Guristas, and he has built the Harriers out of a ragtag band of cut-throats and wolfs-heads no less ruthless, violent and rapacious."; marketGroupId= Some(2030); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
