      | 54909 -> { ItemTypeData.id= 54909; name= "Guardian Eden's Hunters SKIN"; published= true; description= "Eager to support and promote the efforts of capsuleers hunting Triglavian structures and vessels, EDENCOM commissioned the design of a unique nanocoating for use on ships piloted by capsuleers aggressively taking the fight to the enemy. The  Eden's Hunters  nanocoating displays clearly the allegiance of capsuleer seek, destroy and salvage teams to the cause of the New Eden Common Defense Initiative. Funds from the sale of this nanocoating will go directly to the New Eden Defense Fund, aiding the struggle against the invaders."; marketGroupId= Some(2077); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 55006 -> { ItemTypeData.id= 55006; name= "Men's 'Eico BioSec' Facial Augmentation (OLD)"; published= false; description= "Environmental information capture overlays go several steps beyond somatosensory meshes and considerably enhance the sensory capabilities of those  wearing  such extensive facial augmentations. While this level of cybernetics can hardly be masked by mere nanocoatings there is still considerable scope for working in decorative elements.    Eico augmentations include systems that improve the connection between an augmented individual's consciousness and their nervous-emotional responses. However, these more extensive and elaborate information capture and processing systems hugely increase the types and range of environmental information that can be absorbed by an individual.    Whether sipping cocktails in the zero-g bars of Caille, or ripping apart the sputtering remains of a pirate vessel with your guns in nullsec, one thing will be certain: those who see your face will have it etched into their memory forever."; marketGroupId= Some(1836); groupId= 1670; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.100000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
      | 55297 -> { ItemTypeData.id= 55297; name= "Sentinel Biosecurity Responders SKIN"; published= true; description= "CONCORD Biosecurity Responders are available to be dispatched on emergency call to any space stations, orbital infrastructure or other space-industrial locations in response to disease and pathogen outbreaks of all kinds.  The challenges of maintaining biosecurity against infectious pathogens and other disease vectors in space-based infrastructure are multiplied by the cosmopolition and highly-interconnected nature of New Eden's space industry and trade networks. This long-recognised problem was for many decades dealt with by the empires, nations and corporations of New Eden in a rather piecemeal fashion, with disputes over jurisdiction and differing standards commonly arising.  Following the Kyonoke Crisis of YC119, and the passage of the interstellar  Hope for All Act , CONCORD established Biosecurity Response Teams, and began to build up its capacity and expertise in the fields of epidemiology and disease management. To that end, CONCORD reached out to partners such as the University of Caille's Department of Epidemiology, Hedion University's School of Medicine, the Sisters of EVE, and the Society of Conscious Thought.  Biosecurity Responders are a vital link in any effort to isolate and analyze infectious pathogens spreading through New Eden's space infrastructure, and crucially to prevent spread to planetary populations. Research to develop effective biosecurity methods, treatments and pathogen controls rely on the field research and data provided by the Biosecurity Reponse Teams."; marketGroupId= Some(2055); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
